import React, { Component } from 'react';

class HeroArea extends Component {

  render() {
    return (
      <section id="hero-container">
        <section id="hero">
          <img id="logo" src="../img/logo_white.png" alt="logo" />
        </section>
      </section>
    );
  }
}

export default HeroArea;
